import React from 'react';
import {
  Container,
  Logo,
  NavContainer,
  NavLink,
  NavItemText,
  NavLogInText,
  NavSignUp,
  NavSignUpText,
} from './styles';

const HomeHeader: React.FC = () => {
  return (
    <Container>
      <Logo>Supply Me</Logo>
      <NavContainer>
        <NavLink to="">
          <NavItemText />
        </NavLink>
        <NavLink to="">
          <NavLogInText />
        </NavLink>
        <NavLink to="">
          <NavSignUp />
        </NavLink>
      </NavContainer>
    </Container>
  );
};

export default HomeHeader;
